import Expansor from "../expansor";
import Pastas from "../pastas";

function Relatorios() {
  return (
    <div className="relatorios">
      <Expansor titulo="Relatórios de cadastros">
        <button className="conteudo-expansor">• Empresa</button>
        <button className="conteudo-expansor">• Filiais</button>
      </Expansor>

      <Expansor titulo="Relatórios de estoque"></Expansor>

      <Expansor titulo="Relatórios de provedor"></Expansor>

      <Expansor titulo="Relatórios fiscais"></Expansor>
    </div>
  );
}

export default Relatorios;
